import logo from './logo.svg';
import './App.css';
import React, { useState } from 'react';
import AppointmentForm from './components/AppointmentForm';
import AppointmentList from './components/AppointmentList';
import AppointmentDetails from './components/AppointmentDetails';

function App() {
    const [selectedAppointmentId, setSelectedAppointmentId] = useState(null);

    const handleAppointmentAdded = () => {
        setSelectedAppointmentId(null);
    };

    return (
        <div>
            <h1>Medical Appointment Booking System</h1>
            <AppointmentForm onAppointmentAdded={handleAppointmentAdded} />
            <AppointmentList onSelectAppointment={setSelectedAppointmentId} />
            <AppointmentDetails appointmentId={selectedAppointmentId} />
        </div>
    );
}


export default App;
